pragma solidity ^0.8.17;

interface IPBTokenPartsStore {
    struct Color {
        string name;
        string color;
    }

    struct Palette {
        string name;
        string primary;
        string secondary;
    }

    struct ImagePart {
        string name;
        string svg;
    }

    struct AvailableParts {
        string[] bgColors;
        string[] nogglesColors;
        string[] crowns;
        string[] doodads;
        string[] garlands;
        string[] shields;
        string[] quadrantPalettes;
        string[] reps;
        string[] skills;
        string[] classes;
        string[] traits;
    }

    function bgColorsCount() external view returns (uint256);

    function nogglesColorsCount() external view returns (uint256);

    function crownsCount() external view returns (uint256);

    function doodadsCount() external view returns (uint256);

    function garlandsCount() external view returns (uint256);

    function shieldsCount() external view returns (uint256);

    function quadrantPalettesCount() external view returns (uint256);

    function repsCount() external view returns (uint256);

    function skillsCount() external view returns (uint256);

    function classesCount() external view returns (uint256);

    function traitsCount() external view returns (uint256);

    function getBgColor(uint8 id) external view returns (Color memory);

    function getNogglesColor(uint8 id) external view returns (Color memory);

    function getCrown(uint8 id) external view returns (ImagePart memory);

    function getDoodad(uint8 id) external view returns (ImagePart memory);

    function getGarland(uint8 id) external view returns (ImagePart memory);

    function getShield(uint8 id) external view returns (ImagePart memory);

    function getQuadrantPalette(uint8 id) external view returns (Palette memory);

    function getRep(uint8 id) external view returns (ImagePart memory);

    function getSkill(uint8 id) external view returns (ImagePart memory);

    function getClass(uint8 id) external view returns (ImagePart memory);

    function getTrait(uint8 id) external view returns (ImagePart memory);

    function addBgColor(Color calldata color) external;

    function addNogglesColor(Color calldata color) external;

    function addCrown(ImagePart calldata part) external;

    function addDoodad(ImagePart calldata part) external;

    function addGarland(ImagePart calldata part) external;

    function addShield(ImagePart calldata part) external;

    function addQuadrantPalette(Palette calldata palette) external;

    function addRep(ImagePart calldata part) external;

    function addSkill(ImagePart calldata part) external;

    function addClass(ImagePart calldata part) external;

    function addTrait(ImagePart calldata part) external;

    function getAllParts() external returns (AvailableParts memory);
}
","keccak256":"0x8a1a204d287ce2d7024df71ca7b12afc900d538bee754f5ad46325eaf996f070","license":"MIT"},"contracts/lib/PBTokenDna.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "hardhat/console.sol";
import {IPBTokenPartsStore} from "../interfaces/IPBTokenPartsStore.sol";

library PBTokenDna {
    struct TokenTraits {
        uint8 bgColorId;
        uint8 nogglesColorId;
        uint8 crownId;
        uint8 doodadId;
        uint8 garlandId;
        uint8 shieldId;
        uint8 quadrantPalette1Id;
        uint8 quadrantPalette2Id;
        uint8 repId;
        uint8 skillId;
        uint8 classId;
        uint8 traitId;
    }

    /**
     * @dev using an address as param type to prevent 'invalid type' error when executing tests
     */
    function generateDna(address storeAddress, uint256 seed) public view returns (uint96) {
        IPBTokenPartsStore store = IPBTokenPartsStore(storeAddress);

        require(store.bgColorsCount() > 0, "No bg colors");
        require(store.nogglesColorsCount() > 0, "No noggles colors");
        require(store.crownsCount() > 0, "No crowns");
        require(store.doodadsCount() > 0, "No doodads");
        require(store.garlandsCount() > 0, "No garlands");
        require(store.shieldsCount() > 0, "No shields");
        require(store.quadrantPalettesCount() > 0, "No logo palettes");
        require(store.repsCount() > 0, "No reps");
        require(store.skillsCount() > 0, "No skills");
        require(store.classesCount() > 0, "No classes");
        require(store.traitsCount() > 0, "No traits");

        // not truely random but it won't matter, we want a unique dna based on any number, usually a timestamp
        uint rand = uint(keccak256(abi.encodePacked(seed)));

        return reduceDna(storeAddress, uint96(rand));
    }

    /**
     * @dev using an address as param type to prevent 'invalid type' error when executing tests
     */
    function reduceDna(address storeAddress, uint96 dna) private view returns (uint96) {
        IPBTokenPartsStore store = IPBTokenPartsStore(storeAddress);

        TokenTraits memory image = TokenTraits({
            bgColorId: uint8(dna % store.bgColorsCount()),
            nogglesColorId: uint8((dna >> 8) % store.nogglesColorsCount()),
            crownId: uint8((dna >> 16) % store.crownsCount()),
            doodadId: uint8((dna >> 24) % store.doodadsCount()),
            garlandId: uint8((dna >> 32) % store.garlandsCount()),
            shieldId: uint8((dna >> 40) % store.shieldsCount()),
            quadrantPalette1Id: uint8((dna >> 48) % store.quadrantPalettesCount()),
            quadrantPalette2Id: uint8((dna >> 56) % store.quadrantPalettesCount()),
            repId: uint8((dna >> 64) % store.repsCount()),
            skillId: uint8((dna >> 72) % store.skillsCount()),
            classId: uint8((dna >> 80) % store.classesCount()),
            traitId: uint8((dna >> 88) % store.traitsCount())
        });

        return getDnaFromImage(image);
    }

    function getImageFromDna(uint96 dna) public pure returns (TokenTraits memory) {
        return
            TokenTraits({
                bgColorId: uint8(dna),
                nogglesColorId: uint8((dna >> 8)),
                crownId: uint8((dna >> 16)),
                doodadId: uint8((dna >> 24)),
                garlandId: uint8((dna >> 32)),
                shieldId: uint8((dna >> 40)),
                quadrantPalette1Id: uint8((dna >> 48)),
                quadrantPalette2Id: uint8((dna >> 56)),
                repId: uint8((dna >> 64)),
                skillId: uint8((dna >> 72)),
                classId: uint8((dna >> 80)),
                traitId: uint8((dna >> 88))
            });
    }

    function getDnaFromImage(TokenTraits memory img) public pure returns (uint96 dna) {
        return
            uint96(img.bgColorId) |
            (uint96(img.nogglesColorId) << 8) |
            (uint96(img.crownId) << 16) |
            (uint96(img.doodadId) << 24) |
            (uint96(img.garlandId) << 32) |
            (uint96(img.shieldId) << 40) |
            (uint96(img.quadrantPalette1Id) << 48) |
            (uint96(img.quadrantPalette2Id) << 56) |
            (uint96(img.repId) << 64) |
            (uint96(img.skillId) << 72) |
            (uint96(img.classId) << 80) |
            (uint96(img.traitId) << 88);
    }
}
